import React from "react";
import '../src/index.css';
import Common from "./Common";

const Home=()=>{
    return (
        <>
          <Common name="Grow your buisness with" visit="/services" btnName="Get Started"/>
          <section>
            <Services></Services>
          </section>
          <section>
              <Contact></Contact>
          </section>
           
        </>
    );
}

export default Home;
